import React from "react";
import { useParams } from "react-router";
import { useWishCartContext } from "../../context/WishCartContext";

export const ProductDetail = () => {
  const { id } = useParams();
  console.log(id);
  const {
    state: { products },
  } = useWishCartContext();
  const product = products.find((item) => item.id === id);
  console.log({ product });
  return <></>;
};
